import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';
import Cadastro from '../../pages/Cadastro';
import Login from '../../pages/Login';
import styles from './Header.module.css';

const Header = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isCadastroOpen, setIsCadastroOpen] = useState(false);
  const [isLoginOpen, setIsLoginOpen] = useState(false);
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [isHamburgerOpen, setIsHamburgerOpen] = useState(false);
  const [activeIndex, setActiveIndex] = useState(-1);
  const searchRef = useRef(null);
  const navigate = useNavigate();

  const fetchSearchResults = async (query) => {
    // Lógica de busca
  };

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchQuery) fetchSearchResults(searchQuery);
  };

  const handleInputChange = (e) => {
    const query = e.target.value;
    setSearchQuery(query);
    setIsMenuOpen(!!query);
    if (query) fetchSearchResults(query);
  };

  const handleResultClick = (link) => {
    setIsMenuOpen(false);
    setSearchQuery('');
    navigate(link);
  };

  const toggleHamburgerMenu = () => {
    setIsHamburgerOpen(!isHamburgerOpen);
  };

  return (
    <header>
      <div className={styles.navbar}>
        <Link to="/" className={styles.brandL}>
          <span className={styles.brand}>JUSTIX</span>
        </Link>

        <div className={styles.searchContainer} ref={searchRef}>
          <form onSubmit={handleSearch} className={styles.searchForm}>
            <div className={styles.searchWrapper}>
              <input
                type="text"
                placeholder="Pesquisar..."
                value={searchQuery}
                onChange={handleInputChange}
                className={styles.searchInput}
              />
              <button type="submit" className={styles.searchButton}>
                Buscar
              </button>
            </div>
          </form>
        </div>

        <button onClick={toggleHamburgerMenu} className={styles.hamburgerButton}>
          <div className={styles.hamburgerIcon}></div>
        </button>

        <div className={`${styles.menuContent} ${isHamburgerOpen ? 'open' : ''}`}>
          <button onClick={() => setIsLoginOpen(true)} className={styles.navlinksl}>
            Login
          </button>
          <button onClick={() => setIsCadastroOpen(true)} className={styles.cadastrese}>
            Cadastre-se
          </button>
          <button className={styles.navlinks} onClick={() => setIsDropdownOpen(!isDropdownOpen)}>
            Opções de busca
          </button>
          {isDropdownOpen && (
            <div className={styles.dropdownContent}>
              <Link to="/tribunais">Tribunais</Link>
              <Link to="/foruns">Fóruns</Link>
              <Link to="/juiz">Juízes</Link>
              <Link to="/mediacoes">Mediações</Link>
              <Link to="/advocacia">Advocacia</Link>
              <Link to="/portais">Portais</Link>
            </div>
          )}
        </div>
      </div>
      <Login isOpen={isLoginOpen} onClose={() => setIsLoginOpen(false)} />
      <Cadastro isOpen={isCadastroOpen} onClose={() => setIsCadastroOpen(false)} />
    </header>
  );
};

export default Header;
